INSERT INTO `tbpbpublicaciones` VALUES ('17', 'PUBRL5R00056', 'NE2QU00019', 'NE2QU000', null, '25', 'Notaria de Fé Pública de Primera Clase', null, '1', 'Escritura Pública de Constitución N°25 de la empresa: LOS GALLITOS', 'Testimonio de Constitución N°25 de Notaria de Fé Pública de Primera Clase del distrito de de la empresa LOS GALLITOS', 'Conforme a testomonio N°:25 de fecha 2016-06-15, de la Notaria de Fé Pública de Primera Clase N°:56 del Distrito Judicial La Paz. Se constituye una Sociedad de Responsabilidad Limitada con los siguientes datos.\r\nLa sociedad girará bajo la razón social o denominación de \'LOS GALLITOS s.r.l.\'\r\n\r\nTendrá su domicilio en La Paz, Estado Plurinacional de Bolivia\r\n\r\nLa sociedad tendrá una duración de 100 años computables null\r\n\r\nLa Actividad Principal de la Sociedad será:\r\nCodigo Clase Ciiu:2811, Descripción:Fabricación de motores y turbinas, excepto motores para aeronaves, vehículos automotores y motocicletas\r\nLa Sociedad tiene las siguientes actividades Secundarias:\r\ndfgdfdfgdfgdf dfgfdg dfgdf dfgdfg dfgdf df\r\n\r\nEl capital de la Sociedad es de 10000.0/100 dividido en 100.0 cuotas de capital de 100.0/100 Bolivianos cada una.\r\n\r\nLa sociedad esta compuesta por los siguentes socios:\r\nSocio o Socia: JUAN PEREZ CUETO, con Cedula de Identidad 4885548 expedida en LP, Estado Civil:Soltero(a), de profesión:ASASF, Nacionalidad:BOLIVIANA, con domicilio:ASDASD de la zona ASDAS\r\nAporto un total de 50.0 Cuotas de Capital, con un aporte de Bs.5000.0 representando el 50.0% de la participación en la Sociedad\r\n\r\nSocio o Socia: SDFSDF SDFS SDFSDF, con Cedula de Identidad FSDF expedida en LP, Estado Civil:Casad(a), de profesión:SDFSD, Nacionalidad:SDFSD, con domicilio:SDF de la zona SDFS\r\nAporto un total de 50.0 Cuotas de Capital, con un aporte de Bs.5000.0 representando el 50.0% de la participación en la Sociedad\r\n\r\n', '2016-07-01 15:33:04', '2016-07-14', '2016-07-01', null, '1', 'Esperando Pago', null, null, null, null, null);
INSERT INTO `tbpbpublicaciones` VALUES ('18', 'PUBVAZS00060', '00013125', '00013125', null, null, null, null, '2', 'NOTIFICACION DE CAMBIO DE LOCAL DE LA EMPRESA: BANCO DE CREDITO DE BOLIVIA S.A.', 'La empresa BANCO DE CREDITO DE BOLIVIA S.A. con Matrícula de Comercio:00013125  anuncia su cambio de dirección a: fdvdv, N°vdfdb', 'La empresa BANCO DE CREDITO DE BOLIVIA S.A. con Matrícula de Comercio:00013125  anuncia su cambio de dirección a: fdvdv, N°vdfdb', '2016-07-07 18:01:47', '2016-07-08', '2016-07-07', null, '2', 'Esperando Pago', null, null, 'ffff', '44.00', '2016-07-07');
INSERT INTO `tbpbpublicaciones` VALUES ('19', 'PUBZBNU00059', '00333332', '00333332', null, null, null, null, '2', 'Aviso de transferencia  de cuotas de capital de la sociedad: DECOHERRAJES - I  S.R.L.', 'Aviso de transferencia  de cuotas de capital de la sociedad: DECOHERRAJES - I  S.R.L.', '<p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">SEÑOR NOTARIO DE FE PUBLICA</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">En el registro de escrituras públicas a su cargo, sírvase insertar una de transferencia de cuotas de capital, retiro de socios e ingreso de otros, de acuerdo a las siguientes cláusulas:</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">Primera.- Dirá Ud., que mediante escritura pública N° ……/………. de ……… de ………., otorgada por ante el Notario Público de este Distrito Judicial, don …………….. quedó constituida la So­ciedad de Responsabilidad Limitada que gira bajo la denominación de y con el rótulo o abreviatura de …………….. Ltda. Agregará Ud., asimismo que, mediante escritura pública N°………… de……… de ………. de ……….., otor­gada por ante el mismo Notario, se procedió a la adecuación de la consti­tución, organización y funcionamiento de la Sociedad a las nuevas dispo­siciones del Código de Comercio, estando la Sociedad, al presente, inte­grada por los socios, con los aportes de capital, acciones y porcentajes que se especifican a continuación:</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>SOCIOS<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>CAPITAL<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>ACCIONES<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>PORCENTAJE</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>“Agencia…”<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>Bs.125.000.-<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>125<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>50%</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>B.S.I.<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>Bs. 88.000.-<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>88<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>35%</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>F.S. deT.<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>Bs. 37.000.-<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>37<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>15%</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>TOTALES:<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>Bs.250.000,-<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>250<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>1000/o</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">Segunda.- El socio B.S.I., poseedor y propietario de ochenta y ocho cuo­tas de capital, de mil bolivianos cada una, por convenir a sus intereses, de su libre y espontánea voluntad transfiere la totalidad de sus cuotas de capital, en favor del señor R.CH., por un valor nominal de OCHENTA Y OCHO MIL 00/1 00 BOLIVIANOS (Bs. 88.000.-), suma que el vendedor declara recibir a su entera satisfacción, en moneda de curso legal y co­rriente al firmar la presente minuta, hecho del que Ud., señor Notario, hará constar expresamente.</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">Tercera.- Por su parte, la socia F.S. de T., poseedora y propietaria de treinta y siete cuotas de capital de mil bolivianos cada una, del mismo modo, por convenir a sus intereses, de su libre y espontánea voluntad, transfiere la totalidad de las mismas, en favor de las siguientes personas: veinticinco cuotas de capital, en favor del señor X.X., por un valor nominal de VEINTICINCO MIL 00/1 00 BOLIVIANOS (Bs. 25.000.-) y doce cuotas de capital, en favor del señor R.CH., por un valor nominal de DOCE MIL 00/1 00 BOLIVIANOS (Bs. 12.000.-), sumas que la vendedora declara ha­ber recibido a su plena satisfacción, en moneda de curso legal y corriente, a tiempo de firmar la presente minuta, hecho del cual, Ud., señor Notario, en la misma forma, se dignará hacer constar expresamente.</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">Cuarta.- Como consecuencia de las transferencias efectuadas en las cláu­sulas segunda y tercera, los socios B.S.I. y F.S. de T., se retiran de la Sociedad, declarando y reconociendo en forma expresa, que no tienen cuentas pendientes, deudas ni acreencias con ……………. Ltda. (…………. Ltda.”), y si algún derecho existiese renuncian en favor de los compradores en la proporción que a cada uno le corresponde.</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">Quinta.- Nosotros, R.CH. y XX. , aceptamos las transferencias de cuotas de capital que los señores B.S.I. y F.S.deT., hacen a nuestro favor y, consiguientemente, ingresamos como socios al ………………. Ltda. (…………… Ltda.”), declarando que conocemos las normas contrac­tuales que rigen el funcionamiento de la Sociedad, comprometiéndonos a su fiel observancia y acatamiento.</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">Sexta.- En virtud de las transferencias efectuadas en las cláusulas segun­da y tercera, el capital totalmente pagado de……………… Ltda. (…………. Ltda.”) y que asciende a la suma de DOSCIENTOS CINCUEN­TA MIL 00/1 00 BOLIVIANOS (Bs.250.000.-), se encuentra distribuido al presente entre los socios, en las siguientes cantidades, cuotas y porcenta­jes de participación:</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>SOCIOS<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>CAPITAL<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>CUOTAS<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>PORCENTAJES</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>“Agencias”<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>125.000.-<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>125<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>50%</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>R.Ch.<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>100.000.-<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>100<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>40%</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>X.X.<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>25.000.-<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>25<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>10%</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>TOTALES:<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>250.000.-<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>250<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>100%</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">Séptima.- (Designación y facultades del Gerente). Por acuerdo unánime de los socios se designa Gerente General de la Sociedad, al señor R.CH., y se le confiere el presente poder general, amplio y suficiente, para que por sí mismo, como accionista y sus mandantes y en nombre y represen­tación de la Sociedad …………… Ltda. (………. Ltda.”), administre, dirija y conduzca los negocios, intereses, bienes y derechos en general de la Sociedad, con las amplias facultades del mandato general. A tal efecto se le confiere las facultades de: a) llevar la representación legal y social de la Firma ante toda clase de autoridades del país y del exterior, sean administrativas, judiciales, políticas, municipales, laborales, banca­rias, sociedades, empresas nacionales y extranjeras, entidades autóno­mas y autárquicas, personas naturales y jurídicas, de derecho público y/o privado, estatales y descentralizadas; b) realizar toda clase de gestiones, trámites, solicitudes ante autoridades nombradas y ante las que tenga empeñados los intereses de la Firma; c) realizar ajustes administrativos, técnicos y comerciales que sean necesarios para el mejor funcionamiento de la Sociedad. Solicitar y realizar anotaciones preventivas y/o definitivas, registros e inscripciones de títulos, escrituras, documentos y otros valores ante las oficinas de Derechos Reales del país, Dirección General y Depar­tamental de Tránsito, Dirección de la Renta Interna y cualquiera otra enti­dad que se relacione con las actividades de ………………… Ltda., (………….. Ltda.); d) solicitar y obtener toda clase de permisos, licencias, resoluciones, legalizaciones, adjudicaciones y autori­zaciones, concurrir a Juntas de Almonedas, licitaciones, convocatorias a propuestas de cualquier naturaleza que sea, con voz y voto. Solicitar y obtener el registro de marcas de fábricas, rótulos comerciales, patentes de invención y otros ante las autoridades que sean encargadas conforme a ley, tanto del país como del exterior. Oponerse al registro que soliciten otras personas naturales o jurídicas; e) exigir y obtener garantías prendarías, hipotecarias o personales para las transacciones comerciales. Suscribir contratos de transporte aéreo, marítimo, terrestre y fluvial para las merca­derías importadas, exportadas o en tránsito, dentro o fuera del país. Sus­cribir y tomar seguros de toda clase; f) importar y comercializar toda clase de mercaderías que sean de interés para la Firma; g) recibir la correspon­dencia y contestarla, despachar telex, radios, retirar certificadas, paque­tes postales y aduaneros; hacer y contratar despachos aduaneros por la importación de mercaderías; fijar comisiones, porcentajes, emolumentos, haberes y otros que se necesiten dentro de las relaciones de la Sociedad con personas y empresas públicas y privadas; h) sin el consentimiento de los socios o sus apoderados, podrá contratar personal de empleados y obreros, fijarlos su emolumentos, haberes y atribuciones, disponer ascen­sos, promociones, retirar al personal que no cumpla con sus obligaciones y cuyos servicios no sean necesarios para la Firma. Ordenar liquidaciones ~,‘ finiquitos, pagando los beneficios sociales conforme a ley; i) Sustituir y reasumir el presente mandato en forma total o parcial; j) conferir poderes especiales a terceras personas para la atención de determinados asuntos concretándoles sus atribuciones y facultades; k) realizar cobranzas judi­ciales y extrajudiciales, iniciar demandas y proseguir las iniciadas, sean civiles, penales, ejecutivas, sociales, administrativas, contencioso-tributarias, agrarias y otras, contestar demandas nuevas, reconvenir, opo­ner excepciones, incidentes, tercerías de dominio excluyente o coadyuvante, jurar, deferir a juramentos, presentar pruebas, tachar las de contrario, acusar, recusar, compulsar, apelar y recurrir de nulidad; plantear habeas corpus, pedir amparos administrativos y constitucionales; solici­tar liquidaciones, mandamientos, apremios, arraigos, embargos, secues­tros, decomisos, órdenes instruidas, depósitos judiciales, desgloses, co­pias legalizadas, informes, remates, adjudicaciones, resoluciones, sen­tencias, enmiendas, aclaraciones y complementaciones, calificación de fianza, declinatoria de jurisdicción, designar peritos, depositarios, jueces árbitros, interventores y síndicos; concurrir a juntas de acreedores, deba­tes, audiencias, inspecciones y otras diligencias. Aceptar y/o rechazar pro­posiciones de pago, solicitar reconocimiento y cotejo de firmas y rúbri­cas, pedir anotaciones preventivas y definitivas; renunciar a términos le­gales, desistir y admitir desistimientos, transigir y aceptar transacciones; impugnar requerimientos y dictámenes fiscales, informes y otros. 1) pagar impuestos, recabar comprobantes de pago, observar e impugnar notas de cargo y resoluciones que no estén conformes a los intereses de la Empre­sa; iniciar y proseguir en todas sus instancias demandas administrativas y contencioso-tributarias; II) vender, hipotecar, dar en prenda los bienes mue­bles e inmuebles de la Sociedad, así como vehículos, maquinarias, re­puestos y accesorios, suscribiendo los correspondientes documentos públicos y privados. Contraer préstamos y obligaciones bancarias, y de cualquier naturaleza que sean, dar y tomar cartas de crédito, préstamos, fianzas y garantías, abrir y cerrar cuentas corrientes bancarias, naciona­les y extranjeras, realizar depósitos de dinero, cheques y otros valores, endosar cheques para depósitos en cuenta corriente de la Firma; m) girar cheques contra las cuentas corrientes bancarias nacionales y del exterior, girar, aceptar, avalar y endosar letras de cambio. Suscribir documentos de préstamo de dinero, de garantía prendaría e hipotecaria, de compraventa de inmuebles, vehículos, maquinarias, de avance en cuentas corrientes; descuento y renovación de letras de cambio, pagarés, libranzas y demás documentos mercantiles; n) solicitar, gestionar y tramitar créditos y financiamientos bancarios y de entidades financieras nacionales o del ex­terior, públicas o privadas; ñ)en suma, se faculta al apoderado realizar</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">cualquier gestión, trámite o diligencias encaminada a la mejor marcha de la Sociedad; sobreentendiéndose que le son concedidas todas las facultades propias de un mandato general para administración de empresas, con la limitación de que la Firma Social no podrá ser utilizada por el Gerente ni por ninguno de los socios para garantizar documentos de favor.</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">Octava.- Nosotros, B.S.I. y F.S. de T., de generales conocidas consigna­das en la escritura de adecuación N°…………. de ………… de …………….. de ………….; Agencia……… Ltda., legalmente representada por su Gerente, don X.X.; R.CH., de …………… años de edad, casado, boliviano, de profesión ………………, con C.I. N°…………., domiciliado en …………. N° … de esta ciudad y X.X. , por propio derecho de …………. años de edad, boliviano, casado, comerciante, con Cl. N°…………, domiciliado en la calle………….. N°………… de esta misma capital, declaramos nuestra conformidad con los términos y cláusulas contractuales de la presente minuta, a la que reconocemos el valor de documento privado mientras sea elevado a ins­trumento público, dejando constancia que las transferencias de cuotas de capital consignadas en las cláusulas segunda y tercera se ha efectuado con la aprobación unánime de todos los socios, dando cabal cumplimiento a lo establecido en la cláusula …………… de la escritura de adecuación N°………. /………… de………… de ……….. de …………..</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">Usted señor Notario, se servirá agregar las demás cláusulas de seguridad y estilo.</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">Lugar y fecha.</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"> </p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"> </p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>Fdo. …………….                   Fdo. …………………</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"><span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>Fdo. …………….<span style=\"margin: 0px; padding: 0px; border: 0px; font-style: inherit; font-variant: inherit; font-weight: inherit; font-stretch: inherit; font-size: inherit; line-height: inherit; font-family: inherit; vertical-align: baseline; white-space: pre;\"> </span>Fdo………………….</p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\"> </p><p style=\"margin: 0px; padding: 0px; border: 0px; font-stretch: inherit; font-size: medium; line-height: 24px; font-family: Raleway, sans-serif; vertical-align: baseline; color: rgb(102, 102, 102); background-color: rgb(255, 255, 255);\">p.p. Agencia …………………. Ltda.</p>', '2016-07-07 12:04:55', '2016-07-09', '2016-07-07', null, '2', 'Esperando Pago', null, null, 'hh', '0.00', '2016-07-07');
INSERT INTO `tbpbpublicaciones` VALUES ('20', 'PUB09XJ00061', '00333332', '00333332', null, null, null, null, '2', 'Aviso de transferencia  de cuotas de capital de la sociedad: DECOHERRAJES - I  S.R.L.', 'Aviso de transferencia  de cuotas de capital de la sociedad: DECOHERRAJES - I  S.R.L.', '<div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><b>En el registro de escrituras públicas a su cargo, sírvase insertar una de transferencia de cuotas de capital, retiro de socios e ingreso de otros, de acuerdo a las siguientes cláusulas:</b></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><b>Primera.- Dirá Ud., que mediante escritura pública N° ……/………. de ……… de ………., otorgada por ante el Notario Público de este Distrito Judicial, don …………….. quedó constituida la So­ciedad de Responsabilidad Limitada que gira bajo la denominación de y con el rótulo o abreviatura de …………….. Ltda. Agregará Ud., asimismo que, mediante escritura pública N°………… de……… de ………. de ……….., otor­gada por ante el mismo Notario, se procedió a la adecuación de la consti­tución, organización y funcionamiento de la Sociedad a las nuevas dispo­siciones del Código de Comercio, estando la Sociedad, al presente, inte­grada por los socios, con los aportes de capital, acciones y porcentajes que se especifican a continuación:</b></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;SOCIOS &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; CAPITAL &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ACCIONES &nbsp; &nbsp;PORCENTAJE</b></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;“Agencia...” &nbsp; &nbsp; &nbsp; &nbsp; Bs.125.000.- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 125 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 50%</b></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;B.S.I. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Bs. 88.000.- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;88 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 35%</b></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;F.S. deT. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Bs. 37.000.- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;37 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 15%</b></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><b>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;TOTALES: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Bs.250.000,- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 250 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1000/o</b></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><b>Segunda.- El socio B.S.I., poseedor y propietario de ochenta y ocho cuo­tas de capital, de mil bolivianos cada una, por convenir a sus intereses, de su libre y espontánea voluntad transfiere la totalidad de sus cuotas de capital, en favor del señor R.CH., por un valor nominal de OCHENTA Y OCHO MIL 00/1 00 BOLIVIANOS (Bs. 88.000.-), suma que el vendedor declara recibir a su entera satisfacción, en moneda de curso legal y co­rriente al firmar la presente minuta, hecho del que Ud., señor Notario, hará constar expresamente.</b></span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\"><b>Tercera.- Por su parte, la socia F.S. de T., poseedora y propietaria de treinta y siete cuotas de capital de mil bolivianos cada una, del mismo modo, por convenir a sus intereses, de su libre y espontánea voluntad, transfiere la totalidad de las mismas, en favor de las siguientes personas: veinticinco cuotas de capital, en favor del señor X.X., por un valor nominal de VEINTICINCO MIL 00/1 00 BOLIVIANOS (Bs. 25.000.-) y doce cuotas de capital, en favor del señor R.CH., por un valor nominal de DOCE MIL 00/1 00 BOLIVIANOS (Bs. 12.000.-), sumas que la vendedora declara ha­ber recibido a su plena satisfacción, en moneda de curso legal y corriente, a tiempo de firmar la presente minuta, hecho del cual, Ud., señor Notario, en la misma forma, se dignará hacer constar expresamente.</b></span></font></div>', '2016-07-08 09:37:44', '2016-07-14', '2016-07-08', null, '2', 'Esperando Pago', null, null, '655', '125.00', '2016-07-07');
