INSERT INTO `tbpbpublicaciones` VALUES ('24', 'CNV0PI700028', '00013125', '00013125', null, null, null, null, '2', 'Convocatoria a Junta General Ordinaria de Accionistas: BANCO DE CREDITO DE BOLIVIA S.A.', 'CONVOCATORIA A JUNTA GENERAL ORDINARIA DE ACCIONISTAS A LLEVARSE A CABO EL:2016/07/22, a horas:10:00', 'CONVOCATORIA A JUNTA GENERAL ORDINARIA DE ACCIONISTAS\n ----------------------------------------------------\nBANCO DE CREDITO DE BOLIVIA S.A.\nEl Directorio de BANCO DE CREDITO DE BOLIVIA S.A., de acuerdo a lo dispuesto por los Estatutos de la Sociedad y\nArtículos 288 y 289 del Código de Comercio Boliviano, convoca a la Junta General Ordinaria de\nAccionistas, que se llevará a cabo el día 2016-07-22 , a horas 10:00, en el domicilio\nlegal de la sociedad, ubicado en ffff, de la ciudad de Achacachi,\nEstado Plurinacional de Bolivia, para considerar el siguiente Orden del Día:\nOrden del día:\njjjj\nRequisitos para Asistir a la Junta:\nPara concurrir a la citada Junta General Ordinaria de Accionistas, los titulares de acciones nominativas deberán estar debidamente registrados en el Libro de Registro de Acciones de la Sociedad.  \r\n No podrán concurrir a la Junta los accionistas que se encuentren en alguna situación prevista por los Estatutos Sociales considerada como impedimento. \nDesde el día de la última publicación, quedará suspendido el registro de transferencias, así como el\nregistro de transmisión de acciones hasta el día siguiente posterior a la realización de la Junta.\n ', '2016-07-13 09:51:50', '2016-07-14', '2016-07-13', null, '2', 'Esperando Pago', null, '', 'fff', '444.00', '2016-07-13');
INSERT INTO `tbpbpublicaciones` VALUES ('25', 'CNVA7HS00029', '00013125', '00013125', null, null, null, null, '2', 'Convocatoria a Junta General Ordinaria de Accionistas: BANCO DE CREDITO DE BOLIVIA S.A.', 'CONVOCATORIA A JUNTA GENERAL ORDINARIA DE ACCIONISTAS A LLEVARSE A CABO EL:2016/07/29, a horas:09:35', 'CONVOCATORIA A JUNTA GENERAL ORDINARIA DE ACCIONISTAS\n ----------------------------------------------------\nBANCO DE CREDITO DE BOLIVIA S.A.\nEl Directorio de BANCO DE CREDITO DE BOLIVIA S.A., de acuerdo a lo dispuesto por los Estatutos de la Sociedad y\nArtículos 288 y 289 del Código de Comercio Boliviano, convoca a la Junta General Ordinaria de\nAccionistas, que se llevará a cabo el día 2016-07-29 , a horas 09:35, en el domicilio\nlegal de la sociedad, ubicado en sdfsd, de la ciudad de Chayanta,\nEstado Plurinacional de Bolivia, para considerar el siguiente Orden del Día:\nOrden del día:\nsdfsdfsdf\nRequisitos para Asistir a la Junta:\nPara concurrir a la citada Junta General Ordinaria de Accionistas, los titulares de acciones nominativas deberán estar debidamente registrados en el Libro de Registro de Acciones de la Sociedad.  \r\n No podrán concurrir a la Junta los accionistas que se encuentren en alguna situación prevista por los Estatutos Sociales considerada como impedimento. \nDesde el día de la última publicación, quedará suspendido el registro de transferencias, así como el\nregistro de transmisión de acciones hasta el día siguiente posterior a la realización de la Junta.\n ', '2016-07-13 09:55:34', '2016-07-14', '2016-07-13', null, '2', 'Esperando Pago', null, null, '2554445', '1255.00', '2016-07-13');
