INSERT INTO `tbpbpublicaciones` VALUES ('36', 'PUB30DH00074', '00113673', '00113673', null, null, null, null, '2', 'Aviso de transferencia  de cuotas de capital de la sociedad:  \"LOBO MARINO S.R.L.\"', 'Aviso de transferencia  de cuotas de capital de la sociedad:  \"LOBO MARINO S.R.L.\"', '<div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">OTRO MODELO DE ESCRITURA DE TRANSFERENCIA DE CUOTAS DE CAPITAL, RETIRO DE SOCIOS E INGRESO DE OTROS EN SOCIEDAD DE RESPONSABILIDAD LIMITADA.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">SEÑOR NOTARIO DE FE PUBLICA</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">En el registro de escrituras públicas a su cargo, sírvase insertar una de transferencia de cuotas de capital, retiro de socios e ingreso de otros, de acuerdo a las siguientes cláusulas:</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Primera.- Dirá Ud., que mediante escritura pública N° ……/………. de ……… de ………., otorgada por ante el Notario Público de este Distrito Judicial, don …………….. quedó constituida la So­ciedad de Responsabilidad Limitada que gira bajo la denominación de y con el rótulo o abreviatura de …………….. Ltda. Agregará Ud., asimismo que, mediante escritura pública N°………… de……… de ………. de ……….., otor­gada por ante el mismo Notario, se procedió a la adecuación de la consti­tución, organización y funcionamiento de la Sociedad a las nuevas dispo­siciones del Código de Comercio, estando la Sociedad, al presente, inte­grada por los socios, con los aportes de capital, acciones y porcentajes que se especifican a continuación:</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;SOCIOS &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; CAPITAL &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;ACCIONES &nbsp; &nbsp;PORCENTAJE</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;“Agencia...” &nbsp; &nbsp; &nbsp; &nbsp; Bs.125.000.- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 125 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 50%</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;B.S.I. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Bs. 88.000.- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;88 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 35%</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;F.S. deT. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Bs. 37.000.- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;37 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 15%</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;TOTALES: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Bs.250.000,- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 250 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 1000/o</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Segunda.- El socio B.S.I., poseedor y propietario de ochenta y ocho cuo­tas de capital, de mil bolivianos cada una, por convenir a sus intereses, de su libre y espontánea voluntad transfiere la totalidad de sus cuotas de capital, en favor del señor R.CH., por un valor nominal de OCHENTA Y OCHO MIL 00/1 00 BOLIVIANOS (Bs. 88.000.-), suma que el vendedor declara recibir a su entera satisfacción, en moneda de curso legal y co­rriente al firmar la presente minuta, hecho del que Ud., señor Notario, hará constar expresamente.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Tercera.- Por su parte, la socia F.S. de T., poseedora y propietaria de treinta y siete cuotas de capital de mil bolivianos cada una, del mismo modo, por convenir a sus intereses, de su libre y espontánea voluntad, transfiere la totalidad de las mismas, en favor de las siguientes personas: veinticinco cuotas de capital, en favor del señor X.X., por un valor nominal de VEINTICINCO MIL 00/1 00 BOLIVIANOS (Bs. 25.000.-) y doce cuotas de capital, en favor del señor R.CH., por un valor nominal de DOCE MIL 00/1 00 BOLIVIANOS (Bs. 12.000.-), sumas que la vendedora declara ha­ber recibido a su plena satisfacción, en moneda de curso legal y corriente, a tiempo de firmar la presente minuta, hecho del cual, Ud., señor Notario, en la misma forma, se dignará hacer constar expresamente.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Cuarta.- Como consecuencia de las transferencias efectuadas en las cláu­sulas segunda y tercera, los socios B.S.I. y F.S. de T., se retiran de la Sociedad, declarando y reconociendo en forma expresa, que no tienen cuentas pendientes, deudas ni acreencias con ……………. Ltda. (…………. Ltda.”), y si algún derecho existiese renuncian en favor de los compradores en la proporción que a cada uno le corresponde.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Quinta.- Nosotros, R.CH. y XX. , aceptamos las transferencias de cuotas de capital que los señores B.S.I. y F.S.deT., hacen a nuestro favor y, consiguientemente, ingresamos como socios al ………………. Ltda. (…………… Ltda.”), declarando que conocemos las normas contrac­tuales que rigen el funcionamiento de la Sociedad, comprometiéndonos a su fiel observancia y acatamiento.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Sexta.- En virtud de las transferencias efectuadas en las cláusulas segun­da y tercera, el capital totalmente pagado de……………… Ltda. (…………. Ltda.”) y que asciende a la suma de DOSCIENTOS CINCUEN­TA MIL 00/1 00 BOLIVIANOS (Bs.250.000.-), se encuentra distribuido al presente entre los socios, en las siguientes cantidades, cuotas y porcenta­jes de participación:</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;SOCIOS &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;CAPITAL &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; CUOTAS &nbsp; &nbsp; &nbsp; &nbsp;PORCENTAJES</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;“Agencias” &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;125.000.- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 125 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 50%</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;R.Ch. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 100.000.- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 100 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 40%</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;X.X. &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;25.000.- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;25 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 10%</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;TOTALES: &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 250.000.- &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 250 &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 100%</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Séptima.- (Designación y facultades del Gerente). Por acuerdo unánime de los socios se designa Gerente General de la Sociedad, al señor R.CH., y se le confiere el presente poder general, amplio y suficiente, para que por sí mismo, como accionista y sus mandantes y en nombre y represen­tación de la Sociedad …………… Ltda. (………. Ltda.”), administre, dirija y conduzca los negocios, intereses, bienes y derechos en general de la Sociedad, con las amplias facultades del mandato general. A tal efecto se le confiere las facultades de: a) llevar la representación legal y social de la Firma ante toda clase de autoridades del país y del exterior, sean administrativas, judiciales, políticas, municipales, laborales, banca­rias, sociedades, empresas nacionales y extranjeras, entidades autóno­mas y autárquicas, personas naturales y jurídicas, de derecho público y/o privado, estatales y descentralizadas; b) realizar toda clase de gestiones, trámites, solicitudes ante autoridades nombradas y ante las que tenga empeñados los intereses de la Firma; c) realizar ajustes administrativos, técnicos y comerciales que sean necesarios para el mejor funcionamiento de la Sociedad. Solicitar y realizar anotaciones preventivas y/o definitivas, registros e inscripciones de títulos, escrituras, documentos y otros valores ante las oficinas de Derechos Reales del país, Dirección General y Depar­tamental de Tránsito, Dirección de la Renta Interna y cualquiera otra enti­dad que se relacione con las actividades de ………………… Ltda., (………….. Ltda.); d) solicitar y obtener toda clase de permisos, licencias, resoluciones, legalizaciones, adjudicaciones y autori­zaciones, concurrir a Juntas de Almonedas, licitaciones, convocatorias a propuestas de cualquier naturaleza que sea, con voz y voto. Solicitar y obtener el registro de marcas de fábricas, rótulos comerciales, patentes de invención y otros ante las autoridades que sean encargadas conforme a ley, tanto del país como del exterior. Oponerse al registro que soliciten otras personas naturales o jurídicas; e) exigir y obtener garantías prendarías, hipotecarias o personales para las transacciones comerciales. Suscribir contratos de transporte aéreo, marítimo, terrestre y fluvial para las merca­derías importadas, exportadas o en tránsito, dentro o fuera del país. Sus­cribir y tomar seguros de toda clase; f) importar y comercializar toda clase de mercaderías que sean de interés para la Firma; g) recibir la correspon­dencia y contestarla, despachar telex, radios, retirar certificadas, paque­tes postales y aduaneros; hacer y contratar despachos aduaneros por la importación de mercaderías; fijar comisiones, porcentajes, emolumentos, haberes y otros que se necesiten dentro de las relaciones de la Sociedad con personas y empresas públicas y privadas; h) sin el consentimiento de los socios o sus apoderados, podrá contratar personal de empleados y obreros, fijarlos su emolumentos, haberes y atribuciones, disponer ascen­sos, promociones, retirar al personal que no cumpla con sus obligaciones y cuyos servicios no sean necesarios para la Firma. Ordenar liquidaciones ~,‘ finiquitos, pagando los beneficios sociales conforme a ley; i) Sustituir y reasumir el presente mandato en forma total o parcial; j) conferir poderes especiales a terceras personas para la atención de determinados asuntos concretándoles sus atribuciones y facultades; k) realizar cobranzas judi­ciales y extrajudiciales, iniciar demandas y proseguir las iniciadas, sean civiles, penales, ejecutivas, sociales, administrativas, contencioso-tributarias, agrarias y otras, contestar demandas nuevas, reconvenir, opo­ner excepciones, incidentes, tercerías de dominio excluyente o coadyuvante, jurar, deferir a juramentos, presentar pruebas, tachar las de contrario, acusar, recusar, compulsar, apelar y recurrir de nulidad; plantear habeas corpus, pedir amparos administrativos y constitucionales; solici­tar liquidaciones, mandamientos, apremios, arraigos, embargos, secues­tros, decomisos, órdenes instruidas, depósitos judiciales, desgloses, co­pias legalizadas, informes, remates, adjudicaciones, resoluciones, sen­tencias, enmiendas, aclaraciones y complementaciones, calificación de fianza, declinatoria de jurisdicción, designar peritos, depositarios, jueces árbitros, interventores y síndicos; concurrir a juntas de acreedores, deba­tes, audiencias, inspecciones y otras diligencias. Aceptar y/o rechazar pro­posiciones de pago, solicitar reconocimiento y cotejo de firmas y rúbri­cas, pedir anotaciones preventivas y definitivas; renunciar a términos le­gales, desistir y admitir desistimientos, transigir y aceptar transacciones; impugnar requerimientos y dictámenes fiscales, informes y otros. 1) pagar impuestos, recabar comprobantes de pago, observar e impugnar notas de cargo y resoluciones que no estén conformes a los intereses de la Empre­sa; iniciar y proseguir en todas sus instancias demandas administrativas y contencioso-tributarias; II) vender, hipotecar, dar en prenda los bienes mue­bles e inmuebles de la Sociedad, así como vehículos, maquinarias, re­puestos y accesorios, suscribiendo los correspondientes documentos públicos y privados. Contraer préstamos y obligaciones bancarias, y de cualquier naturaleza que sean, dar y tomar cartas de crédito, préstamos, fianzas y garantías, abrir y cerrar cuentas corrientes bancarias, naciona­les y extranjeras, realizar depósitos de dinero, cheques y otros valores, endosar cheques para depósitos en cuenta corriente de la Firma; m) girar cheques contra las cuentas corrientes bancarias nacionales y del exterior, girar, aceptar, avalar y endosar letras de cambio. Suscribir documentos de préstamo de dinero, de garantía prendaría e hipotecaria, de compraventa de inmuebles, vehículos, maquinarias, de avance en cuentas corrientes; descuento y renovación de letras de cambio, pagarés, libranzas y demás documentos mercantiles; n) solicitar, gestionar y tramitar créditos y financiamientos bancarios y de entidades financieras nacionales o del ex­terior, públicas o privadas; ñ)en suma, se faculta al apoderado realizar</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">cualquier gestión, trámite o diligencias encaminada a la mejor marcha de la Sociedad; sobreentendiéndose que le son concedidas todas las facultades propias de un mandato general para administración de empresas, con la limitación de que la Firma Social no podrá ser utilizada por el Gerente ni por ninguno de los socios para garantizar documentos de favor.</span></font></div><div><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Octava.- Nosotros, B.S.I. y F.S. de T., de generales conocidas consigna­das en la escritura de adecuación N°…………. de ………… de …………….. de ………….; Agencia……… Ltda., legalmente representada por su Gerente, don X.X.; R.CH., de …………… años de edad, casado, boliviano, de profesión ………………, con C.I. N°…………., domiciliado en …………. N° … de esta ciudad y X.X. , por propio derecho de …………. años de edad, boliviano, casado, comerciante, con Cl. N°…………, domiciliado en la calle………….. N°………… de esta misma capital, declaramos nuestra conformidad con los términos y cláusulas contractuales de la presente minuta, a la que reconocemos el valor de documento privado mientras sea elevado a ins­trumento público, dejando constancia que las transferencias de cuotas de capital consignadas en las cláusulas segunda y tercera se ha efectuado con la aprobación unánime de todos los socios, dando cabal cumplimiento a lo establecido en la cláusula …………… de la escritura de adecuación N°………. /………… de………… de ……….. de …………..</span></font></div>', '2016-07-14 09:31:40', '2016-07-14', '2016-07-14', null, '1', 'Publicado', null, null, '32423', '443.00', '2016-07-14');
INSERT INTO `tbpbpublicaciones` VALUES ('37', 'PUB1I0500075', '00113673', '00113673', null, null, null, null, '2', 'Aviso de transferencia  de cuotas de capital de la sociedad:  \"LOBO MARINO S.R.L.\"', 'Aviso de transferencia  de cuotas de capital de la sociedad:  \"LOBO MARINO S.R.L.\"', '<div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">OTRO MODELO DE ESCRITURA DE TRANSFERENCIA DE CUOTAS DE CAPITAL, RETIRO DE SOCIOS E INGRESO DE OTROS EN SOCIEDAD DE RESPONSABILIDAD LIMITADA.</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">SEÑOR NOTARIO DE FE PUBLICA</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">En el registro de escrituras públicas a su cargo, sírvase insertar una de transferencia de cuotas de capital, retiro de socios e ingreso de otros, de acuerdo a las siguientes cláusulas:</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Primera.- Dirá Ud., que mediante escritura pública N° ……/………. de ……… de ………., otorgada por ante el Notario Público de este Distrito Judicial, don …………….. quedó constituida la So­ciedad de Responsabilidad Limitada que gira bajo la denominación de y con el rótulo o abreviatura de …………….. Ltda. Agregará Ud., asimismo que, mediante escritura pública N°………… de……… de ………. de ……….., otor­gada por ante el mismo Notario, se procedió a la adecuación de la consti­tución, organización y funcionamiento de la Sociedad a las nuevas dispo­siciones del Código de Comercio, estando la Sociedad, al presente, inte­grada por los socios, con los aportes de capital, acciones y porcentajes que se especifican a continuación:</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">         SOCIOS             CAPITAL          ACCIONES    PORCENTAJE</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">         “Agencia...”         Bs.125.000.-             125                           50%</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">         B.S.I.                   Bs. 88.000.-                88                           35%</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">         F.S. deT.              Bs. 37.000.-                37                           15%</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">         TOTALES:          Bs.250.000,-             250                       1000/o</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Segunda.- El socio B.S.I., poseedor y propietario de ochenta y ocho cuo­tas de capital, de mil bolivianos cada una, por convenir a sus intereses, de su libre y espontánea voluntad transfiere la totalidad de sus cuotas de capital, en favor del señor R.CH., por un valor nominal de OCHENTA Y OCHO MIL 00/1 00 BOLIVIANOS (Bs. 88.000.-), suma que el vendedor declara recibir a su entera satisfacción, en moneda de curso legal y co­rriente al firmar la presente minuta, hecho del que Ud., señor Notario, hará constar expresamente.</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Tercera.- Por su parte, la socia F.S. de T., poseedora y propietaria de treinta y siete cuotas de capital de mil bolivianos cada una, del mismo modo, por convenir a sus intereses, de su libre y espontánea voluntad, transfiere la totalidad de las mismas, en favor de las siguientes personas: veinticinco cuotas de capital, en favor del señor X.X., por un valor nominal de VEINTICINCO MIL 00/1 00 BOLIVIANOS (Bs. 25.000.-) y doce cuotas de capital, en favor del señor R.CH., por un valor nominal de DOCE MIL 00/1 00 BOLIVIANOS (Bs. 12.000.-), sumas que la vendedora declara ha­ber recibido a su plena satisfacción, en moneda de curso legal y corriente, a tiempo de firmar la presente minuta, hecho del cual, Ud., señor Notario, en la misma forma, se dignará hacer constar expresamente.</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Cuarta.- Como consecuencia de las transferencias efectuadas en las cláu­sulas segunda y tercera, los socios B.S.I. y F.S. de T., se retiran de la Sociedad, declarando y reconociendo en forma expresa, que no tienen cuentas pendientes, deudas ni acreencias con ……………. Ltda. (…………. Ltda.”), y si algún derecho existiese renuncian en favor de los compradores en la proporción que a cada uno le corresponde.</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Quinta.- Nosotros, R.CH. y XX. , aceptamos las transferencias de cuotas de capital que los señores B.S.I. y F.S.deT., hacen a nuestro favor y, consiguientemente, ingresamos como socios al ………………. Ltda. (…………… Ltda.”), declarando que conocemos las normas contrac­tuales que rigen el funcionamiento de la Sociedad, comprometiéndonos a su fiel observancia y acatamiento.</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Sexta.- En virtud de las transferencias efectuadas en las cláusulas segun­da y tercera, el capital totalmente pagado de……………… Ltda. (…………. Ltda.”) y que asciende a la suma de DOSCIENTOS CINCUEN­TA MIL 00/1 00 BOLIVIANOS (Bs.250.000.-), se encuentra distribuido al presente entre los socios, en las siguientes cantidades, cuotas y porcenta­jes de participación:</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">         SOCIOS            CAPITAL           CUOTAS        PORCENTAJES</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">         “Agencias”              125.000.-               125                           50%</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">         R.Ch.                       100.000.-               100                           40%</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">         X.X.                          25.000.-                25                           10%</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">         TOTALES:             250.000.-               250                         100%</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Séptima.- (Designación y facultades del Gerente). Por acuerdo unánime de los socios se designa Gerente General de la Sociedad, al señor R.CH., y se le confiere el presente poder general, amplio y suficiente, para que por sí mismo, como accionista y sus mandantes y en nombre y represen­tación de la Sociedad …………… Ltda. (………. Ltda.”), administre, dirija y conduzca los negocios, intereses, bienes y derechos en general de la Sociedad, con las amplias facultades del mandato general. A tal efecto se le confiere las facultades de: a) llevar la representación legal y social de la Firma ante toda clase de autoridades del país y del exterior, sean administrativas, judiciales, políticas, municipales, laborales, banca­rias, sociedades, empresas nacionales y extranjeras, entidades autóno­mas y autárquicas, personas naturales y jurídicas, de derecho público y/o privado, estatales y descentral