y obreros, fijarlos su emolumentos, haberes y atribuciones, disponer ascen­sos, promociones, retirar al personal que no cumpla con sus obligaciones y cuyos servicios no sean necesarios para la Firma. Ordenar liquidaciones ~,‘ finiquitos, pagando los beneficios sociales conforme a ley; i) Sustituir y reasumir el presente mandato en forma total o parcial; j) conferir poderes especiales a terceras personas para la atención de determinados asuntos concretándoles sus atribuciones y facultades; k) realizar cobranzas judi­ciales y extrajudiciales, iniciar demandas y proseguir las iniciadas, sean civiles, penales, ejecutivas, sociales, administrativas, contencioso-tributarias, agrarias y otras, contestar demandas nuevas, reconvenir, opo­ner excepciones, incidentes, tercerías de dominio excluyente o coadyuvante, jurar, deferir a juramentos, presentar pruebas, tachar las de contrario, acusar, recusar, compulsar, apelar y recurrir de nulidad; plantear habeas corpus, pedir amparos administrativos y constitucionales; solici­tar liquidaciones, mandamientos, apremios, arraigos, embargos, secues­tros, decomisos, órdenes instruidas, depósitos judiciales, desgloses, co­pias legalizadas, informes, remates, adjudicaciones, resoluciones, sen­tencias, enmiendas, aclaraciones y complementaciones, calificación de fianza, declinatoria de jurisdicción, designar peritos, depositarios, jueces árbitros, interventores y síndicos; concurrir a juntas de acreedores, deba­tes, audiencias, inspecciones y otras diligencias. Aceptar y/o rechazar pro­posiciones de pago, solicitar reconocimiento y cotejo de firmas y rúbri­cas, pedir anotaciones preventivas y definitivas; renunciar a términos le­gales, desistir y admitir desistimientos, transigir y aceptar transacciones; impugnar requerimientos y dictámenes fiscales, informes y otros. 1) pagar impuestos, recabar comprobantes de pago, observar e impugnar notas de cargo y resoluciones que no estén conformes a los intereses de la Empre­sa; iniciar y proseguir en todas sus instancias demandas administrativas y contencioso-tributarias; II) vender, hipotecar, dar en prenda los bienes mue­bles e inmuebles de la Sociedad, así como vehículos, maquinarias, re­puestos y accesorios, suscribiendo los correspondientes documentos públicos y privados. Contraer préstamos y obligaciones bancarias, y de cualquier naturaleza que sean, dar y tomar cartas de crédito, préstamos, fianzas y garantías, abrir y cerrar cuentas corrientes bancarias, naciona­les y extranjeras, realizar depósitos de dinero, cheques y otros valores, endosar cheques para depósitos en cuenta corriente de la Firma; m) girar cheques contra las cuentas corrientes bancarias nacionales y del exterior, girar, aceptar, avalar y endosar letras de cambio. Suscribir documentos de préstamo de dinero, de garantía prendaría e hipotecaria, de compraventa de inmuebles, vehículos, maquinarias, de avance en cuentas corrientes; descuento y renovación de letras de cambio, pagarés, libranzas y demás documentos mercantiles; n) solicitar, gestionar y tramitar créditos y financiamientos bancarios y de entidades financieras nacionales o del ex­terior, públicas o privadas; ñ)en suma, se faculta al apoderado realizar</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">cualquier gestión, trámite o diligencias encaminada a la mejor marcha de la Sociedad; sobreentendiéndose que le son concedidas todas las facultades propias de un mandato general para administración de empresas, con la limitación de que la Firma Social no podrá ser utilizada por el Gerente ni por ninguno de los socios para garantizar documentos de favor.</span></font></div><div style=\"text-align: justify;\"><font face=\"Arial, Verdana\"><span style=\"font-size: 13.3333px;\">Octava.- Nosotros, B.S.I. y F.S. de T., de generales conocidas consigna­das en la escritura de adecuación N°…………. de ………… de …………….. de ………….; Agencia……… Ltda., legalmente representada por su Gerente, don X.X.; R.CH., de …………… años de edad, casado, boliviano, de profesión ………………, con C.I. N°…………., domiciliado en …………. N° … de esta ciudad y X.X. , por propio derecho de …………. años de edad, boliviano, casado, comerciante, con Cl. N°…………, domiciliado en la calle………….. N°………… de esta misma capital, declaramos nuestra conformidad con los términos y cláusulas contractuales de la presente minuta, a la que reconocemos el valor de documento privado mientras sea elevado a ins­trumento público, dejando constancia que las transferencias de cuotas de capital consignadas en las cláusulas segunda y tercera se ha efectuado con la aprobación unánime de todos los socios, dando cabal cumplimiento a lo establecido en la cláusula …………… de la escritura de adecuación N°………. /………… de………… de ……….. de …………..</span></font></div>', '2016-07-14 09:36:33', '2016-07-14', '2016-07-14', null, '1', 'Publicado', null, null, 'dsdf', '33.00', '2016-07-14');
