INSERT INTO `tbpbpublicaciones` VALUES ('54', 'PUBP55M00092', 'NEUIL00022', 'NEUIL00022', null, '125', 'Notaria de Fé Pública de Primera Clase', null, '1', 'Escritura Pública de Constitución N°125 de la empresa: La Sociedad de los amigos null', 'Testimonio de Constitución N°125 de Notaria de Fé Pública de Primera Clase del distrito de de la empresa La Sociedad de los amigos null', 'Conforme a testomonio N°:125 de fecha 2016-07-01, de la Notaria de Fé Pública de Primera Clase N°:25 del Distrito Judicial La Paz. Se constituye una Sociedad de Responsabilidad Limitada con los siguientes datos.\r\nLa sociedad girará bajo la razón social o denominación de \'La Sociedad de los amigos S.R.L.\'\r\n\r\nTendrá su domicilio en La Paz, Estado Plurinacional de Bolivia\r\n\r\nLa sociedad tendrá una duración de 100 años computables null\r\n\r\nLa Actividad Principal de la Sociedad será:\r\nCodigo Clase Ciiu:4510, Descripción:Venta de vehículos automotores\r\nLa Sociedad tiene las siguientes actividades Secundarias:\r\nalquiler de vehiculos\r\n\r\nEl capital de la Sociedad es de 10000.0/100 dividido en 100.0 cuotas de capital de 100.0/100 Bolivianos cada una.\r\n\r\nLa sociedad esta compuesta por los siguentes socios:\r\nSocio o Socia: FUNES APAZA JUAN, con Cedula de Identidad 15555 expedida en CH, Estado Civil:Casad(a), de profesión:ADM. EMPRESAS, Nacionalidad:BOLIVIANA, con domicilio:RICARDO MUJIA 3126 de la zona SOPOCACHI\r\nAporto un total de 60.0 Cuotas de Capital, con un aporte de Bs.6000.0 representando el 60.0% de la participación en la Sociedad\r\n\r\nSocio o Socia: JUAN PERES ALCALA, con Cedula de Identidad 15555 expedida en LP, Estado Civil:Casad(a), de profesión:ADM DE EMPRESA, Nacionalidad:BOLIVIANA, con domicilio:RICARDO MUJIA de la zona SOPOCAHC\r\nAporto un total de 40.0 Cuotas de Capital, con un aporte de Bs.4000.0 representando el 40.0% de la participación en la Sociedad\r\n\r\n', '2016-07-15 13:50:13', null, '2016-07-15', null, '1', 'En Revisión', null, null, null, null, null);
INSERT INTO `tbpbpublicaciones` VALUES ('55', 'CNVVRQ200032', '00013125', '00013125', '2', null, null, null, '2', 'Convocatoria a Junta General Ordinaria de Accionistas: BANCO DE CREDITO DE BOLIVIA S.A.', 'CONVOCATORIA A JUNTA GENERAL ORDINARIA DE ACCIONISTAS A LLEVARSE A CABO EL:2016/08/18, a horas:09:00', '<p>El Directorio de BANCO DE CREDITO DE BOLIVIA S.A., de acuerdo a lo dispuesto por los Estatutos de la Sociedad y\nArtículos 288 y 289 del Código de Comercio Boliviano, convoca a la Junta General Ordinaria de\nAccionistas, que se llevará a cabo el día 2016-08-18 , a horas 09:00, en el domicilio\nlegal de la sociedad, ubicado en sdfvs, de la ciudad de Achacachi,\nEstado Plurinacional de Bolivia, para considerar el siguiente Orden del Día:</p><p>1.55gggh</p><p>2.gfgf</p><p>3.fhgh</p><br/><p>Requisitos para Asistir a la Junta:</p><p>Para concurrir a la citada Junta General Ordinaria de Accionistas, los titulares de acciones nominativas deberán estar debidamente registrados en el Libro de Registro de Acciones de la Sociedad.  \n No podrán concurrir a la Junta los accionistas que se encuentren en alguna situación prevista por los Estatutos Sociales considerada como impedimento. </p><br/>De conformidad con el artículo 294 del Código de Comercio Boliviano, desde el día de la publicación, quedará suspendido el registro de transferencias,\n así como el registro de transmisión de acciones, hasta el día siguiente posterior a la realizacion de la junta</font></div>', '2016-08-12 23:50:13', '2016-08-03', '2016-08-12', null, '2', 'Esperando Pago', null, null, null, null, null);
